import React, {Component} from 'react';
import CardList from './CardList';
import {robots} from './robots';
import SearchBox from './SearchBox'

const state = {
	robots: robots,
	searchfield: ''
}

class App extends Component {
	constructor() {
		this.state = {
			robots: robots,
			searchfield: ''
		}
	}
	render() {
		return(
			<div className='tc'>
				<h1>RobotNet</h1>
				<SearchBox />
		  		<CardList robots={robots}/>
			</div>
		);
	}
}

export default App;
